import React from 'react'

class Welcome extends React.Component{
    render() {
      const List = ['todo', 'done'];
      return (
        <div>
          <ul>
            {List.map(item =>
              <li>{}</li>
            )}
          </ul>
        </div>
      )
    }
}

export default Welcome
